#https://leetcode.com/problems/gas-station

from typing import List

class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        length = len(gas)
        i = 0
        isrotate = False
        while i < length and isrotate == False:
            currentIndex = i
            result = gas[i]
            while True:
                nextIndex=currentIndex+1
                if nextIndex >= length:
                    nextIndex=0

                result = result - cost[currentIndex]

                if  result < 0:
                    if i == length - 1:
                        return -1
                    else:
                        i = currentIndex
                        break
                
                result = result  + gas[nextIndex]

                if currentIndex == length - 1:
                    isrotate = True
                    currentIndex = 0
                else:
                    currentIndex += 1

                if currentIndex == i:
                    return i

            i += 1
        return -1



s = Solution()
print(s.canCompleteCircuit([1,2,3,4,5], [3,4,5,1,2]), 3)
print(s.canCompleteCircuit([2,3,4], [3,4,3]), -1)
print(s.canCompleteCircuit([5,1,2,3,4], [4,4,1,5,1]), 4)
print(s.canCompleteCircuit([1,2,3,4,5,5,70], [2,3,4,3,9,6,2]), 6)
print(s.canCompleteCircuit([3,3,4], [3, 4, 4]), -1)
print(s.canCompleteCircuit([2], [2]), 0)
print(s.canCompleteCircuit([4,5,2,6,5,3], [3,2,7,3,2,9]), -1)
